INPUT = '



'

KEYPAD = [
  'XXXXXXX',
  'XXX1XXX',
  'XX234XX',
  'X56789X',
  'XXABCXX',
  'XXXDXXX',
  'XXXXXXX'
]

x = 1
y = 3

INPUT.split("\n").each do |line|
  line.chars.each do |ch|
    dx = {?U=>0,?R=>1,?D=>0,?L=>-1}[ch]
    dy = {?U=>-1,?R=>0,?D=>1,?L=>0}[ch]

    if KEYPAD[y+dy][x+dx] != ?X
      x += dx
      y += dy
    end
  end
  print KEYPAD[y][x]
end
print "\n"

